import React from "react";
import Carousel from "react-carousel-with-thumbnail";
import image1 from "../../../images/carousel-1.png";
import image2 from "../../../images/carousel-2.png";
import image3 from "../../../images/carousel-3.png";

const Carousels = () => {
  return (
    <div style={{ height: "400px", backgroundColor: "#111430" }}>
      <Carousel width="800px" height="500px" thumbHeight="80px">
        <img src={image1} alt="image-1" />
        <img src={image2} alt="image-2" />
        <img src={image3} alt="image-3" />
      </Carousel>
    </div>
  );
};

export default Carousels;
